import React from 'react';

const PropertyCard = ({ property }) => {
  const handleImageError = (e) => {
    // Fallback to placeholder if image fails to load
    e.target.style.display = 'none';
    e.target.nextSibling.style.display = 'flex';
  };

  const handleBookNow = () => {
    alert(`Booking ${property.title} in ${property.location} for $${property.price}/night!`);
    // In a real app, this would redirect to booking page or open booking modal
  };

  return (
    <div className="property-card">
      <div className="property-image-container">
        <img 
          src={property.image} 
          alt={property.title}
          className="property-image"
          onError={handleImageError}
        />
        <div className="property-image-fallback">
          {property.imageText || 'Property Image'}
        </div>
      </div>
      <div className="property-info">
        <h3 className="property-title">{property.title}</h3>
        <p className="property-location">{property.location}</p>
        <p className="property-price">${property.price}/night</p>
        <button 
          className="btn btn-primary book-button"
          onClick={handleBookNow}
        >
          Book Now
        </button>
      </div>
    </div>
  );
};

export default PropertyCard;
